Defendant Tobias E Jones in court with attorney Brian Christopher Hagner.  Sara Nicole Volden Schroeder appeared for the State of Wisconsin.  Deputy Court Clerk ssm.

AS TO COUNT 1:  Pursuant to plea negotiations and on motion of the State, Court ordered count dismissed and read-in.

AS TO COUNT 2:  Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Fanique P.  Defendant sentenced to serve 9 MONTHS in the House of Correction with credit for 2 days time served; STRAIGHT TIME.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 12 MONTHS.
Conditions: 
*  AODA assessment/treatment;
*  Mental health assessment and any treatment deemed appropriate by agent (anger management/cognitive thinking/batterer's intervention);
*  Obtain GED/HSED;
*  No contact with Fanique P.
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.  
Notice of Right to Seek Postconviction Relief received and filed.
